class PopulateDatabase:
    def fetchRoutes(self):
        r = requests.get("https://developer.cumtd.com/api/v2.2/json/getroutes?key=536deb9cd523409c8bd3ac7197756cd5")
        routes = r.json()["routes"]

        data = []
        route_ids = []

        for route in routes:
            entry = [route["route_id"], route["route_color"], route["route_short_name"]]
            route_ids.append(route["route_id"])
            # print(tuple(entry), "\n")
            data.append(tuple(entry))
        #print(route_ids)
        return data
    
    def fetchBuses(self):
        r = requests.get("https://developer.cumtd.com/api/v2.2/json/getvehicles?key=536deb9cd523409c8bd3ac7197756cd5")
        buses = r.json()["vehicles"]

        data = []

        for bus in buses:
            trip = bus["trip"]
            entry = [bus["vehicle_id"], trip["route_id"], bus["origin_stop_id"], bus["destination_stop_id"], trip["direction"], trip["shape_id"]]
            # print(tuple(entry), "\n")
            data.append(tuple(entry))

        return data
    
    def fetchStops(self):
        r = requests.get("https://developer.cumtd.com/api/v2.2/json/getstops?key=536deb9cd523409c8bd3ac7197756cd5")
        stops = r.json()["stops"]
        jsonstr = json.dumps(stops)
        jsonfile = open("busStopData.json", "w")
        jsonfile.write(jsonstr)
        jsonfile.close()
        #print(jsonstr)
        print(type(jsonstr))

        data = []
        stop_ids = []

        for stop in stops:
            stop_points = stop["stop_points"][0]
            entry = [stop["stop_id"], stop_points["stop_lat"], stop_points["stop_lon"]]
            stop_ids.append(stop["stop_id"])
            # print(tuple(entry), "\n")
            data.append(tuple(entry))
        #print(stop_ids)
        #print(data)
        return data

